INSERT INTO resort (numresort, codepays, nomresort, descriptionresort, moyenneavis, nbchambrestotal, nbtridents) VALUES (nextval('resort_numresort_seq'), 'FR', 'Tignes', 'Vibrez au cœur des Alpes ! Tignes 3 Tridents est le resort de ceux qui vivent le sport intensément. Profitez d''une ambiance conviviale et festive, avec un accès direct à un domaine skiable de renommée mondiale. L''altitude est une fête, le ski est roi !', 3.24, 200, 3);
INSERT INTO resort (numresort, codepays, nomresort, descriptionresort, moyenneavis, nbchambrestotal, nbtridents) VALUES (nextval('resort_numresort_seq'), 'IT', 'Val d''Isère', 'Plongez dans l''authenticité d''un village alpin légendaire. Val d''Isère 3 Tridents allie charme savoyard et accès à l''un des plus beaux espaces de ski au monde. C''est le choix parfait pour les passionnés de glisse à la recherche de convivialité et de grands espaces.', 3.7, 331, 3);
INSERT INTO resort (numresort, codepays, nomresort, descriptionresort, moyenneavis, nbchambrestotal, nbtridents) VALUES (nextval('resort_numresort_seq'), 'CH', 'Val Thorens', 'Atteignez les sommets du luxe et de la glisse à Val Thorens, 4 Tridents. Au cœur du plus grand domaine skiable du monde, ce resort premium vous offre des vues à couper le souffle, un confort chic et un accès ski-aux-pieds inégalé. L''expérience haute-altitude par excellence.', 3.0, 336, 4);
INSERT INTO resort (numresort, codepays, nomresort, descriptionresort, moyenneavis, nbchambrestotal, nbtridents) VALUES (nextval('resort_numresort_seq'), 'GR', 'La Plagne', 'Le paradis des familles et des skieurs de tous niveaux ! La Plagne 3 Tridents vous accueille dans une atmosphère chaleureuse et décontractée. Découvrez l''immense domaine de Paradiski et partagez des moments inoubliables, le tout dans un confort tout-compris.', 3.21, 194, 3);
INSERT INTO resort (numresort, codepays, nomresort, descriptionresort, moyenneavis, nbchambrestotal, nbtridents) VALUES (nextval('resort_numresort_seq'), 'MA', 'Méribel', 'L''élégance au cœur des 3 Vallées. Méribel 4 Tridents est un écrin de raffinement et de charme alpin. Profitez d''un service premium, d''une gastronomie soignée et d''un emplacement de rêve pour dévaler les pistes du plus grand domaine skiable du monde.', 3.45, 352, 4);
INSERT INTO resort (numresort, codepays, nomresort, descriptionresort, moyenneavis, nbchambrestotal, nbtridents) VALUES (nextval('resort_numresort_seq'), 'ES', 'Courchevel', 'Vivez l''exclusivité à Courchevel, 4 Tridents. Ce resort premium combine le frisson du ski d''exception et l''art de vivre à la française. Dans un cadre prestigieux, profitez d''un service attentionné et d''un accès direct aux pistes légendaires des 3 Vallées.', 4.19, 245, 4);
INSERT INTO resort (numresort, codepays, nomresort, descriptionresort, moyenneavis, nbchambrestotal, nbtridents) VALUES (nextval('resort_numresort_seq'), 'MX', 'Chamonix', 'Face au Mont-Blanc, vivez la légende de l''alpinisme. Chamonix 3 Tridents est le camp de base idéal pour les aventuriers et les amoureux de la montagne. Un resort vibrant où l''on se retrouve après une journée d''émotions fortes pour partager ses exploits.', 3.72, 329, 3);
INSERT INTO resort (numresort, codepays, nomresort, descriptionresort, moyenneavis, nbchambrestotal, nbtridents) VALUES (nextval('resort_numresort_seq'), 'TR', 'Les Arcs', 'Modernité et sensations fortes à Paradiski ! Le resort des Arcs 3 Tridents vous surprendra par son design audacieux et son ambiance dynamique. Parfait pour les tribus et les accros à la glisse, il offre un terrain de jeu infini pour tous les styles.', 4.26, 293, 3);
INSERT INTO resort (numresort, codepays, nomresort, descriptionresort, moyenneavis, nbchambrestotal, nbtridents) VALUES (nextval('resort_numresort_seq'), 'AE', 'Valmorel', 'Le charme d''un village authentique, le confort d''un 4 Tridents. Valmorel est un cocon de bien-être pour les familles et les couples. Avec ses chalets de pierre et de bois, profitez d''une atmosphère chaleureuse et d''un ski tout en douceur au cœur du Grand Domaine.', 3.36, 246, 4);
INSERT INTO resort (numresort, codepays, nomresort, descriptionresort, moyenneavis, nbchambrestotal, nbtridents) VALUES (nextval('resort_numresort_seq'), 'TH', 'Flaine', 'Design et ski d''exception. Flaine 4 Tridents, perché tel un joyau face au Mont-Blanc, est un chef-d''œuvre d''architecture moderne. Profitez d''un confort premium, de vues panoramiques spectaculaires et d''un enneigement exceptionnel au cœur du Grand Massif.', 4.6, 128, 4);
INSERT INTO resort (numresort, codepays, nomresort, descriptionresort, moyenneavis, nbchambrestotal, nbtridents) VALUES (nextval('resort_numresort_seq'), 'FR', 'Les Menuires', 'La convivialité au cœur des 3 Vallées. Les Menuires 3 Tridents est le choix malin pour profiter à 100% du plus grand domaine skiable du monde. Un resort fonctionnel et chaleureux, pensé pour les familles et les groupes d''amis prêts à dévaler les pistes.', 4.9, 393, 3);
INSERT INTO resort (numresort, codepays, nomresort, descriptionresort, moyenneavis, nbchambrestotal, nbtridents) VALUES (nextval('resort_numresort_seq'), 'IT', 'Les 2 Alpes', 'Vivez l''exclusivité à 3600 mètres ! Le resort 5 Tridents des 2 Alpes réinvente le luxe à la montagne. Ski sur glacier, suites spacieuses avec vues imprenables et service de conciergerie : une expérience de ski ultime et sur-mesure pour les plus exigeants.', 3.26, 86, 5);
INSERT INTO resort (numresort, codepays, nomresort, descriptionresort, moyenneavis, nbchambrestotal, nbtridents) VALUES (nextval('resort_numresort_seq'), 'CH', 'Avoriaz', 'L''expérience Exclusive Collection au cœur des Portes du Soleil. Avoriaz 5 Tridents est un joyau d''architecture mimétique, entièrement piéton. Profitez d''un luxe raffiné, d''un spa d''exception et de pistes qui s''offrent à vous dès la sortie du resort.', 3.03, 299, 5);
INSERT INTO resort (numresort, codepays, nomresort, descriptionresort, moyenneavis, nbchambrestotal, nbtridents) VALUES (nextval('resort_numresort_seq'), 'GR', 'Serre Chevalier', 'Le soleil des Alpes du Sud, l''ambiance conviviale en plus. Serre Chevalier 3 Tridents vous accueille dans un cadre naturel préservé. Idéal pour les familles, ce resort combine ski plaisir, bains thermaux et la douceur de vivre provençale en altitude.', 3.83, 119, 3);
INSERT INTO resort (numresort, codepays, nomresort, descriptionresort, moyenneavis, nbchambrestotal, nbtridents) VALUES (nextval('resort_numresort_seq'), 'MA', 'Pra-Loup', 'Le chic décontracté sous le soleil des Alpes du Sud. Pra-Loup 4 Tridents offre une expérience premium dans une station à taille humaine. Entre mélèzes et sommets, profitez d''une ambiance intime et d''un service raffiné après vos journées de ski ensoleillées.', 3.26, 262, 4);
INSERT INTO resort (numresort, codepays, nomresort, descriptionresort, moyenneavis, nbchambrestotal, nbtridents) VALUES (nextval('resort_numresort_seq'), 'ES', 'Alpe d''Huez', 'Vivez le ski au soleil à l''Alpe d''Huez, 4 Tridents ! Surnommée "l''Île au Soleil", cette destination premium vous garantit un ski d''exception et un panorama à couper le souffle. Après l''effort sur la mythique Sarenne, le réconfort d''un resort chic et vibrant vous attend.', 4.7, 359, 4);
INSERT INTO resort (numresort, codepays, nomresort, descriptionresort, moyenneavis, nbchambrestotal, nbtridents) VALUES (nextval('resort_numresort_seq'), 'MX', 'Les Deux Alpes', 'Redécouvrez le ski d''exception aux Deux Alpes, 5 Tridents. Ce resort Exclusive Collection offre une interprétation luxueuse de la montagne. Service personnalisé, design contemporain et accès au glacier en font une destination de prestige pour une glisse sans compromis.', 4.18, 282, 5);
INSERT INTO resort (numresort, codepays, nomresort, descriptionresort, moyenneavis, nbchambrestotal, nbtridents) VALUES (nextval('resort_numresort_seq'), 'TR', 'Megève', 'L''élégance intemporelle au pied du Mont-Blanc. Megève 4 Tridents incarne l''art de vivre alpin. Ce resort premium mêle luxe discret, charme authentique et gastronomie raffinée. Une destination de choix pour ceux qui cherchent l''excellence, sur les pistes comme au chalet.', 3.81, 280, 4);
INSERT INTO resort (numresort, codepays, nomresort, descriptionresort, moyenneavis, nbchambrestotal, nbtridents) VALUES (nextval('resort_numresort_seq'), 'AE', 'Saint Tropez', 'Vivez la légende tropézienne en mode premium. Le resort 4 Tridents de Saint Tropez vous plonge dans le mythe de la Côte d''Azur. Entre plage privée, soirées chics et art de vivre méditerranéen, c''est l''adresse idéale pour une escapade glamour et décontractée.', 3.68, 145, 4);
INSERT INTO resort (numresort, codepays, nomresort, descriptionresort, moyenneavis, nbchambrestotal, nbtridents) VALUES (nextval('resort_numresort_seq'), 'TH', 'Cannes', 'Sous les projecteurs de la Côte d''Azur. Cannes 4 Tridents vous invite à vivre la "French Riviera" avec élégance. Profitez d''un cadre raffiné, d''une plage privée sur la Croisette et d''une ambiance exclusive. Le glamour est inclus, le champagne est frais.', 4.15, 345, 4);
INSERT INTO resort (numresort, codepays, nomresort, descriptionresort, moyenneavis, nbchambrestotal, nbtridents) VALUES (nextval('resort_numresort_seq'), 'FR', 'Nice', 'Le joyau de la Baie des Anges. Nice, 5 Tridents, est une adresse d''exception sur la Promenade des Anglais. Cet espace Exclusive Collection offre un luxe incomparable, des vues mer spectaculaires et un service de conciergerie pour vivre la Côte d''Azur comme jamais.', 4.61, 171, 5);
INSERT INTO resort (numresort, codepays, nomresort, descriptionresort, moyenneavis, nbchambrestotal, nbtridents) VALUES (nextval('resort_numresort_seq'), 'IT', 'Antibes', 'L''exclusivité d''une presqu''île privée. Le resort 5 Tridents d''Antibes est un havre de paix luxueux entre Cannes et Nice. Entouré de jardins luxuriants et de criques secrètes, profitez d''un service sur-mesure, de suites somptueuses et de la quintessence du chic méditerranéen.', 3.95, 260, 5);
INSERT INTO resort (numresort, codepays, nomresort, descriptionresort, moyenneavis, nbchambrestotal, nbtridents) VALUES (nextval('resort_numresort_seq'), 'CH', 'Marrakech La Palmeraie', 'Une oasis de fraîcheur au cœur du désert. Marrakech La Palmeraie 3 Tridents est une explosion de couleurs et de saveurs. Profitez de jardins luxuriants, de piscines rafraîchissantes et de l''ambiance vibrante du Maroc, le tout dans un esprit convivial et familial.', 4.1, 67, 3);
INSERT INTO resort (numresort, codepays, nomresort, descriptionresort, moyenneavis, nbchambrestotal, nbtridents) VALUES (nextval('resort_numresort_seq'), 'GR', 'Agadir', 'Le soleil toute l''année, les pieds dans l''eau. Agadir 3 Tridents vous offre une plage de sable fin à perte de vue. Une destination conviviale parfaite pour se ressourcer en famille, s''initier au surf ou simplement profiter de la douceur de vivre marocaine.', 4.08, 238, 3);
INSERT INTO resort (numresort, codepays, nomresort, descriptionresort, moyenneavis, nbchambrestotal, nbtridents) VALUES (nextval('resort_numresort_seq'), 'MA', 'Saly Senegal', 'Vivez au rythme de la Teranga sénégalaise. Le resort de Saly 3 Tridents est une immersion colorée et chaleureuse en Afrique de l''Ouest. Entre cocotiers et plage de sable fin, profitez d''une ambiance festive et d''une hospitalité sans pareille.', 4.1, 90, 3);
INSERT INTO resort (numresort, codepays, nomresort, descriptionresort, moyenneavis, nbchambrestotal, nbtridents) VALUES (nextval('resort_numresort_seq'), 'ES', 'Cancún', 'La fête et le farniente sous le soleil du Mexique. Cancún 4 Tridents, c''est l''expérience caribéenne premium par excellence. Plages de sable blanc, eaux turquoise, soirées vibrantes et excursions mayas : un paradis tout-inclus pour des vacances inoubliables.', 4.39, 319, 4);
INSERT INTO resort (numresort, codepays, nomresort, descriptionresort, moyenneavis, nbchambrestotal, nbtridents) VALUES (nextval('resort_numresort_seq'), 'MX', 'Punta Cana', 'Le paradis tropical réinventé. Punta Cana 5 Tridents est un écrin de luxe exclusif en République Dominicaine. Avec son espace Zen Oasis réservé aux adultes et ses services haut de gamme, c''est l''évasion parfaite pour un luxe raffiné au bord d''une plage de rêve.', 3.88, 90, 5);
INSERT INTO resort (numresort, codepays, nomresort, descriptionresort, moyenneavis, nbchambrestotal, nbtridents) VALUES (nextval('resort_numresort_seq'), 'TR', 'Bali', 'L''île des Dieux en toute convivialité. Le resort de Bali 3 Tridents vous immerge dans la culture et la beauté indonésienne. Entre rizières et océan, profitez de jardins tropicaux, de cours de yoga et d''une atmosphère sereine pour vous reconnecter à l''essentiel.', 4.69, 95, 3);
INSERT INTO resort (numresort, codepays, nomresort, descriptionresort, moyenneavis, nbchambrestotal, nbtridents) VALUES (nextval('resort_numresort_seq'), 'AE', 'Phuket', 'Le luxe sur-mesure au cœur d''un paradis thaïlandais. Phuket 5 Tridents est une perle de l''Exclusive Collection. Nagez dans votre piscine privée, laissez-vous choyer par votre majordome et admirez les couchers de soleil sur la mer d''Andaman. L''ultime définition de la sérénité.', 3.9, 389, 5);
INSERT INTO resort (numresort, codepays, nomresort, descriptionresort, moyenneavis, nbchambrestotal, nbtridents) VALUES (nextval('resort_numresort_seq'), 'TH', 'Hua Hin', 'L''élégance royale sur les côtes thaïlandaises. Le resort 5 Tridents de Hua Hin, destination historique de la royauté, offre un luxe discret et un raffinement exceptionnel. Un sanctuaire de bien-être exclusif, idéal pour les amateurs de golf et de tranquillité.', 3.15, 374, 5);
INSERT INTO resort (numresort, codepays, nomresort, descriptionresort, moyenneavis, nbchambrestotal, nbtridents) VALUES (nextval('resort_numresort_seq'), 'FR', 'Istanbul', 'Le luxe où l''Orient rencontre l''Occident. Le resort 5 Tridents d''Istanbul, joyau sur le Bosphore, est votre porte d''entrée exclusive vers une ville-monde. Profitez d''un service d''exception et d''une vue imprenable après avoir exploré les trésors de l''ancienne Byzance.', 4.52, 209, 5);
INSERT INTO resort (numresort, codepays, nomresort, descriptionresort, moyenneavis, nbchambrestotal, nbtridents) VALUES (nextval('resort_numresort_seq'), 'IT', 'Bodrum', 'L''exclusivité sur la Riviera turque. Le resort 5 Tridents de Bodrum est un paradis d''exception réservé aux adultes. Dans un cadre idyllique, profitez de suites luxueuses, d''une gastronomie raffinée et d''une atmosphère sereine pour une escapade romantique parfaite.', 3.1, 225, 5);
INSERT INTO resort (numresort, codepays, nomresort, descriptionresort, moyenneavis, nbchambrestotal, nbtridents) VALUES (nextval('resort_numresort_seq'), 'CH', 'Dubai Jumeirah', 'Le futur s''écrit ici. Dubai Jumeirah 4 Tridents est une oasis de modernité premium face au Golfe Persique. Profitez d''une plage privée, d''une architecture audacieuse et d''un service impeccable, avec le dynamisme de la ville la plus spectaculaire du monde à vos pieds.', 4.48, 290, 4);
INSERT INTO resort (numresort, codepays, nomresort, descriptionresort, moyenneavis, nbchambrestotal, nbtridents) VALUES (nextval('resort_numresort_seq'), 'GR', 'Muscat', 'Un palais des Mille et Une Nuits. Le resort 5 Tridents de Muscat, au Sultanat d''Oman, est une adresse confidentielle et luxueuse entre mer et désert. Découvrez un service d''une rare élégance, une architecture somptueuse et le mystère d''une Arabie préservée.', 3.97, 290, 5);
INSERT INTO resort (numresort, codepays, nomresort, descriptionresort, moyenneavis, nbchambrestotal, nbtridents) VALUES (nextval('resort_numresort_seq'), 'MA', 'Belek', 'Le paradis des golfeurs et des familles sur la Riviera turque. Belek 4 Tridents vous offre un service premium exceptionnel, des piscines immenses et un accès direct à des parcours de golf de classe mondiale. Le tout-inclus généreux et raffiné.', 4.39, 265, 4);
INSERT INTO resort (numresort, codepays, nomresort, descriptionresort, moyenneavis, nbchambrestotal, nbtridents) VALUES (nextval('resort_numresort_seq'), 'ES', 'Bodrum Blue', 'Le chic et la sérénité en bord de mer Égée. Réservé aux adultes, le resort 4 Tridents de Bodrum Blue est une bulle de détente premium. Profitez de vues imprenables, d''une ambiance lounge et d''un service attentionné pour des vacances en couple inoubliables.', 4.83, 200, 4);
INSERT INTO resort (numresort, codepays, nomresort, descriptionresort, moyenneavis, nbchambrestotal, nbtridents) VALUES (nextval('resort_numresort_seq'), 'MX', 'Kemer', 'Luxe et festivités sur la côte turquoise. Kemer 5 Tridents est un resort Exclusive Collection vibrant et spectaculaire. Entre mer turquoise et montagnes verdoyantes, profitez d''une atmosphère festive, de sports nautiques de haut niveau et d''un luxe sans compromis.', 3.32, 355, 5);
INSERT INTO resort (numresort, codepays, nomresort, descriptionresort, moyenneavis, nbchambrestotal, nbtridents) VALUES (nextval('resort_numresort_seq'), 'TR', 'Djerba', 'La douceur de vivre tunisienne en mode premium. Djerba 4 Tridents vous accueille dans une oasis de palmiers et de sable blanc. Une destination idéale pour les familles, alliant détente, activités sportives et découverte d''une culture insulaire unique.', 3.58, 338, 4);
INSERT INTO resort (numresort, codepays, nomresort, descriptionresort, moyenneavis, nbchambrestotal, nbtridents) VALUES (nextval('resort_numresort_seq'), 'AE', 'Essaouira', 'Le luxe bohème face à l''Atlantique. Le resort 5 Tridents d''Essaouira est un joyau de l''Exclusive Collection. Protégé par les remparts, profitez d''une atmosphère artistique, d''un golf exceptionnel et d''un service sur-mesure dans la cité mythique des alizés.', 3.12, 292, 5);
INSERT INTO resort (numresort, codepays, nomresort, descriptionresort, moyenneavis, nbchambrestotal, nbtridents) VALUES (nextval('resort_numresort_seq'), 'TH', 'Madeira', 'L''île-jardin en version luxe exclusif. Le resort 5 Tridents de Madeira, perché sur les falaises, offre des vues spectaculaires sur l''océan. Un écrin de luxe botanique, parfait pour les amateurs de randonnée, de bien-être et de sérénité absolue.', 3.32, 76, 5);
INSERT INTO resort (numresort, codepays, nomresort, descriptionresort, moyenneavis, nbchambrestotal, nbtridents) VALUES (nextval('resort_numresort_seq'), 'FR', 'Fuerteventura', 'L''évasion volcanique et sportive aux Canaries. Fuerteventura 3 Tridents est le terrain de jeu idéal pour les amateurs de sports de glisse et les familles. Profitez d''un climat idéal toute l''année, de plages immenses et d''une ambiance conviviale et dynamique.', 4.88, 369, 3);
INSERT INTO resort (numresort, codepays, nomresort, descriptionresort, moyenneavis, nbchambrestotal, nbtridents) VALUES (nextval('resort_numresort_seq'), 'IT', 'Barbados', 'Le rythme des Caraïbes dans un jardin tropical. Le resort 3 Tridents de Barbados vous offre une escapade conviviale sur une île de rêve. Farniente, sports nautiques et ambiance décontractée vous attendent pour goûter à la douceur de vivre "Bajan".', 3.54, 92, 3);
INSERT INTO resort (numresort, codepays, nomresort, descriptionresort, moyenneavis, nbchambrestotal, nbtridents) VALUES (nextval('resort_numresort_seq'), 'CH', 'Punta del Este', 'Le Saint-Tropez de l''Amérique du Sud, version premium. Punta del Este 4 Tridents vous plonge dans l''ambiance chic et festive de l''Uruguay. Entre plages glamour et design raffiné, profitez d''une expérience exclusive alliant gastronomie, polo et soirées élégantes.', 3.96, 192, 4);
INSERT INTO resort (numresort, codepays, nomresort, descriptionresort, moyenneavis, nbchambrestotal, nbtridents) VALUES (nextval('resort_numresort_seq'), 'GR', 'Rio de Janeiro', 'La "Cidade Maravilhosa" en mode tout-inclus premium. Le resort 4 Tridents de Rio de Janeiro est une bulle d''exotisme tropical. Avec des vues imprenables sur la baie, profitez d''une oasis de verdure pour vous ressourcer avant de plonger dans l''énergie vibrante de la ville.', 3.25, 193, 4);
INSERT INTO resort (numresort, codepays, nomresort, descriptionresort, moyenneavis, nbchambrestotal, nbtridents) VALUES (nextval('resort_numresort_seq'), 'MA', 'Cartagena', 'L''exclusivité d''un joyau colonial. Le resort 5 Tridents de Cartagena, au cœur d''une île privée des Caraïbes, est une perle rare. Vivez une expérience luxueuse et intime, alliant le charme de l''histoire colombienne à la beauté d''une nature préservée.', 4.63, 57, 5);
INSERT INTO resort (numresort, codepays, nomresort, descriptionresort, moyenneavis, nbchambrestotal, nbtridents) VALUES (nextval('resort_numresort_seq'), 'ES', 'Los Cabos', 'Le luxe où le désert rencontre l''océan Pacifique. Los Cabos 5 Tridents est une destination Exclusive Collection spectaculaire. Admirez le ballet des baleines depuis votre suite, profitez d''un service d''exception et vivez le Mexique dans sa version la plus luxueuse.', 3.21, 139, 5);
INSERT INTO resort (numresort, codepays, nomresort, descriptionresort, moyenneavis, nbchambrestotal, nbtridents) VALUES (nextval('resort_numresort_seq'), 'MX', 'La Romana', 'L''expérience caribéenne premium pour tous. La Romana 4 Tridents, en République Dominicaine, est un paradis pour les familles et les sportifs. Plage de rêve, école de cirque, golf et détente : tout est réuni pour des vacances tout-inclus pleines d''activités et de sourires.', 4.4, 387, 4);
INSERT INTO resort (numresort, codepays, nomresort, descriptionresort, moyenneavis, nbchambrestotal, nbtridents) VALUES (nextval('resort_numresort_seq'), 'TR', 'Ko Samui', 'La sérénité thaïlandaise dans un écrin premium. Le resort 4 Tridents de Ko Samui est une invitation à la détente. Niché dans un jardin tropical luxuriant, profitez d''une ambiance zen, d''un spa raffiné et de la beauté idyllique des plages de Thaïlande.', 3.7, 139, 4);
INSERT INTO resort (numresort, codepays, nomresort, descriptionresort, moyenneavis, nbchambrestotal, nbtridents) VALUES (nextval('resort_numresort_seq'), 'AE', 'Phangan', 'L''esprit bohème-chic sur une île secrète. Phangan 4 Tridents est une évasion premium loin des foules. Entre criques isolées et jungle luxuriante, profitez d''une atmosphère décontractée, de cours de yoga et de la beauté brute d''une Thaïlande authentique.', 4.49, 170, 4);
INSERT INTO resort (numresort, codepays, nomresort, descriptionresort, moyenneavis, nbchambrestotal, nbtridents) VALUES (nextval('resort_numresort_seq'), 'TH', 'Zanzibar', 'L''île aux épices, une évasion conviviale et exotique. Zanzibar 3 Tridents vous plonge dans un décor de carte postale. Plages de sable blanc, eaux turquoise et culture swahilie : une destination chaleureuse pour une aventure tropicale inoubliable.', 3.34, 320, 3);
